import React from "react";

function Experience({ title, company, startDate, endDate, description }) {
  return (
    <div>
      <div className="center w-50 flex flex-col items-center justify-center container border">
        <div className="d-flex flex-row h-">
          <h2>{title}</h2>
          <h3>Freelance</h3>
          <h4>
            {startDate} - {endDate}
          </h4>
          <p>{description}</p>
        </div>
      </div>
    </div>
  );
}

export default Experience;
